import React from 'react';
import { Link } from 'react-router-dom';
import human from '../images/Rick Human.png';
import alien from '../images/Rick Alien.png';

const CharacterCard = props => {
    return (
        <article className="card">
            <Link to={`/details/${props.name}`} className="link">
                <img src={props.imgUrl} className="card__img" alt={props.name} />
                <div className="card__textcontainer">
                    <h3 className="card__title">{props.name}</h3>
                    <p className="card__specie">{`${props.specie === 'Human' ? <img src={human} alt="human icon" /> : <img src={alien} alt="alien icon" />}`}</p>
                </div>
            </Link>
        </article>
    );
};

export default CharacterCard;
